.thumbnail {
    position: relative;
    cursor: pointer;
    overflow: hidden;
}

    .thumbnail .front {
        position: relative;
        z-index: 20;
    }

    .thumbnail .back {
        position: absolute;
        top: 100%;
        height: 100%;
        width: 100%;
        background: #000;
        color: #FFF;
        text-align: left;
        text-transform: uppercase;
        font-family: "alternate-gothic-no-2-d", sans-serif;
        font-size: 20px;
        color: #FFF;
        font-weight: normal;
        text-decoration: none;
        -webkit-transition: all 1.5s ease;
        -moz-transition: all 1.5s ease;
        -o-transition: all 1.5s ease;
        transition: all 1.5s ease;
    }

    .thumbnail.on .back {
        position: absolute;
        top: 0;
        z-index: 5000;
    }

    .thumbnail .back:before {
        position: absolute;
        top: -3px;
        right: 5px;
        color: #FFF;
        font-weight: normal;
        content: '\00d7';
        font-size: 50px;
        line-height: 50px;
    }

    .thumbnail .back h2 {
        font-family: "alternate-gothic-no-2-d", sans-serif;
        font-size: 1.7em;
        line-height: 1em;
        margin: 0 0 6px;
    }

    .thumbnail .back div,
    .thumbnail .back div a {
        color: #FFF;
        font-weight: normal;
        font-size: 1em;
        line-height: 1em;
        margin: 0 0 6px;
    }

